package main

import (
	"encoding/csv"
	"encoding/json"
	"fmt"
	"io/ioutil"
	"log"
	"os"
	"regexp"
	"strconv"
	"strings"
	"time"
)

// UIMessage represents a message from Cline's UI messages JSON
type UIMessage struct {
	TS   int64  `json:"ts"`
	Type string `json:"type"`
	Say  string `json:"say,omitempty"`
	Text string `json:"text,omitempty"`
}

// APIRequestData represents the parsed API request data from UI messages
type APIRequestData struct {
	Request     string  `json:"request"`
	Cost        float64 `json:"cost"`
	TokensIn    int     `json:"tokensIn"`
	TokensOut   int     `json:"tokensOut"`
	CacheWrites int     `json:"cacheWrites"`
	CacheReads  int     `json:"cacheReads"`
}

// CostEntry represents a single cost tracking entry
type CostEntry struct {
	RequestID              string
	UserRequest            string
	ClineAction            string
	ToolUsed               string
	HasImages              string
	Phase                  string
	ContextTokensUsed      int
	ContextPercentage      string
	SearchTermInTranscript string
	RequestCost            float64
	TotalCost              float64
	CostNotes              string
	Timestamp              string
	TimeApprox             string
}

func main() {
	if len(os.Args) != 3 {
		log.Fatal("Usage: cost_extractor <ui_messages.json> <output.csv>")
	}

	uiMessagesFile := os.Args[1]
	csvFile := os.Args[2]

	// Read and parse ui_messages.json
	data, err := ioutil.ReadFile(uiMessagesFile)
	if err != nil {
		log.Fatalf("❌ Error reading ui_messages.json: %v", err)
	}

	var messages []UIMessage
	if err := json.Unmarshal(data, &messages); err != nil {
		log.Fatalf("❌ Error parsing JSON: %v", err)
	}

	// Extract API costs and build context from user messages
	var apiCosts []CostEntry
	var totalCost float64
	requestCounter := 1

	// Build a map of user messages for context
	userMessages := make(map[int64]string)
	clineResponses := make(map[int64]string)

	// Extract the actual user request from the first "say" message with "text"
	var mainUserRequest string
	for _, msg := range messages {
		if msg.Type == "say" && msg.Say == "text" && msg.Text != "" {
			// This is the actual user request that started the task
			mainUserRequest = msg.Text
			break
		}
	}

	for _, msg := range messages {
		if msg.Type == "ask" && msg.Text != "" {
			// Extract the actual user request text (not lowercased, preserve original)
			userText := msg.Text
			// Keep more context but clean it up
			if len(userText) > 200 {
				userText = userText[:200] + "..."
			}
			// Clean up newlines and extra spaces
			userText = strings.ReplaceAll(userText, "\n", " ")
			userText = strings.ReplaceAll(userText, "\t", " ")
			// Remove multiple spaces
			userText = regexp.MustCompile(`\s+`).ReplaceAllString(userText, " ")
			userText = strings.TrimSpace(userText)
			userMessages[msg.TS] = userText
		} else if msg.Type == "say" && msg.Say == "text" && msg.Text != "" {
			// Extract Cline's responses for determining what Cline actually did
			responseText := msg.Text
			if len(responseText) > 150 {
				responseText = responseText[:150] + "..."
			}
			clineResponses[msg.TS] = responseText
		}
	}

	for _, msg := range messages {
		if msg.Type == "say" && msg.Say == "api_req_started" && msg.Text != "" {
			var apiData APIRequestData
			if err := json.Unmarshal([]byte(msg.Text), &apiData); err == nil {
				// Process all API requests, even with $0 cost
				if true {
					timestamp := time.Unix(msg.TS/1000, (msg.TS%1000)*1000000)
					totalCost += apiData.Cost

					// Extract request details
					actionDescription := "API Request"
					phase := "Unknown"
					searchTerm := "api_request"

					// Find the most recent user message before this API request
					var userRequest string
					var mostRecentUserTS int64
					for ts, userMsg := range userMessages {
						if ts <= msg.TS && ts > mostRecentUserTS {
							userRequest = userMsg
							mostRecentUserTS = ts
						}
					}

					// If no specific user message found, use the main task request
					if userRequest == "" {
						userRequest = mainUserRequest
					}

					// Determine Cline action and check for images
					var clineAction string
					var hasImages string = "No"

					// Check if request or any related messages contain images
					if strings.Contains(apiData.Request, "image") || strings.Contains(apiData.Request, "screenshot") {
						hasImages = "Yes"
					}

					if apiData.Request != "" {
						// Extract tool usage from request
						toolRegex := regexp.MustCompile(`<(\w+)>`)
						if matches := toolRegex.FindStringSubmatch(apiData.Request); len(matches) > 1 {
							toolName := matches[1]

							// Create more meaningful search terms using user context
							if userRequest != "" {
								// Extract key words from user context
								words := strings.Fields(userRequest)
								var keyWords []string
								for _, word := range words {
									if len(word) > 3 && !isCommonWord(word) {
										keyWords = append(keyWords, word)
									}
								}
								if len(keyWords) > 0 {
									searchTerm = fmt.Sprintf("%s_%s", toolName, strings.Join(keyWords[:min(2, len(keyWords))], "_"))
								} else {
									searchTerm = toolName
								}
							} else {
								searchTerm = toolName
							}

							actionDescription = toolName + " operation"

							// Set specific Cline action based on tool and content
							switch toolName {
							case "read_file":
								pathRegex := regexp.MustCompile(`<path>([^<]+)</path>`)
								if matches := pathRegex.FindStringSubmatch(apiData.Request); len(matches) > 1 {
									clineAction = "Read file: " + matches[1]
								} else {
									clineAction = "Read file"
								}
							case "write_to_file":
								pathRegex := regexp.MustCompile(`<path>([^<]+)</path>`)
								if matches := pathRegex.FindStringSubmatch(apiData.Request); len(matches) > 1 {
									clineAction = "Create/update file: " + matches[1]
								} else {
									clineAction = "Create/update file"
								}
							case "replace_in_file":
								pathRegex := regexp.MustCompile(`<path>([^<]+)</path>`)
								if matches := pathRegex.FindStringSubmatch(apiData.Request); len(matches) > 1 {
									clineAction = "Edit file: " + matches[1]
								} else {
									clineAction = "Edit file"
								}
							case "execute_command":
								cmdRegex := regexp.MustCompile(`<command>([^<]+)</command>`)
								if matches := cmdRegex.FindStringSubmatch(apiData.Request); len(matches) > 1 {
									cmd := matches[1]
									if len(cmd) > 40 {
										cmd = cmd[:40] + "..."
									}
									clineAction = "Execute: " + cmd
								} else {
									clineAction = "Execute command"
								}
							case "list_files":
								clineAction = "List files/directories"
							case "search_files":
								clineAction = "Search files"
							case "browser_action":
								clineAction = "Browser interaction"
							case "attempt_completion":
								clineAction = "Complete task"
							case "ask_followup_question":
								clineAction = "Ask user question"
							default:
								clineAction = toolName + " operation"
							}
						}

						// Determine phase based on content
						request := apiData.Request
						switch {
						case strings.Contains(request, "read_file") || strings.Contains(request, "list_files"):
							phase = "Exploration"
						case strings.Contains(request, "write_to_file") || strings.Contains(request, "replace_in_file"):
							phase = "Development"
						case strings.Contains(request, "execute_command"):
							phase = "Execution"
						case strings.Contains(request, "browser_action"):
							phase = "Testing"
						case strings.Contains(request, "attempt_completion"):
							phase = "Completion"
						}

						// Extract more specific action description
						if strings.Contains(request, "write_to_file") {
							pathRegex := regexp.MustCompile(`<path>([^<]+)</path>`)
							if matches := pathRegex.FindStringSubmatch(request); len(matches) > 1 {
								actionDescription = "Create/update file: " + matches[1]
							}
						} else if strings.Contains(request, "read_file") {
							pathRegex := regexp.MustCompile(`<path>([^<]+)</path>`)
							if matches := pathRegex.FindStringSubmatch(request); len(matches) > 1 {
								actionDescription = "Read file: " + matches[1]
							}
						} else if strings.Contains(request, "execute_command") {
							cmdRegex := regexp.MustCompile(`<command>([^<]+)</command>`)
							if matches := cmdRegex.FindStringSubmatch(request); len(matches) > 1 {
								cmd := matches[1]
								if len(cmd) > 50 {
									cmd = cmd[:50] + "..."
								}
								actionDescription = "Execute: " + cmd
							}
						}
					}

					contextTokens := apiData.TokensIn + apiData.TokensOut
					requestID := fmt.Sprintf("REQ_%03d", requestCounter)

					entry := CostEntry{
						RequestID:              requestID,
						UserRequest:            strings.ReplaceAll(userRequest, ",", ";"),
						ClineAction:            strings.ReplaceAll(clineAction, ",", ";"),
						ToolUsed:               strings.ReplaceAll(actionDescription, ",", ";"),
						HasImages:              hasImages,
						Phase:                  phase,
						ContextTokensUsed:      contextTokens,
						ContextPercentage:      "", // Will be calculated later
						SearchTermInTranscript: searchTerm,
						RequestCost:            apiData.Cost,
						TotalCost:              totalCost,
						CostNotes:              "ACTUAL cost from Cline interface",
						Timestamp:              timestamp.Format("2006-01-02 15:04:05"),
						TimeApprox:             timestamp.Format("15:04"),
					}

					apiCosts = append(apiCosts, entry)
					requestCounter++
				}
			}
		}
	}

	if len(apiCosts) == 0 {
		fmt.Println("⚠️  No API costs found in ui_messages.json")
		return
	}

	// Calculate context percentages
	maxTokens := 0
	for _, cost := range apiCosts {
		if cost.ContextTokensUsed > maxTokens {
			maxTokens = cost.ContextTokensUsed
		}
	}

	for i := range apiCosts {
		if maxTokens > 0 {
			percentage := int((float64(apiCosts[i].ContextTokensUsed) / float64(maxTokens)) * 100)
			apiCosts[i].ContextPercentage = fmt.Sprintf("%d%%", percentage)
		} else {
			apiCosts[i].ContextPercentage = "0%"
		}
	}

	// Write to CSV file
	file, err := os.Create(csvFile)
	if err != nil {
		log.Fatalf("❌ Error creating CSV file: %v", err)
	}
	defer file.Close()

	writer := csv.NewWriter(file)
	defer writer.Flush()

	// Write header with new columns in priority order
	header := []string{
		"Request_ID", "User_Request", "Cline_Action", "Tool_Used", "Has_Images",
		"Phase", "Context_Tokens_Used", "Context_Percentage", "Search_Term_In_Transcript",
		"Request_cost", "Total_Cost", "Cost_Notes", "Timestamp", "Time_Approx",
	}
	if err := writer.Write(header); err != nil {
		log.Fatalf("❌ Error writing CSV header: %v", err)
	}

	// Write entries with new columns
	for _, entry := range apiCosts {
		record := []string{
			entry.RequestID,
			entry.UserRequest,
			entry.ClineAction,
			entry.ToolUsed,
			entry.HasImages,
			entry.Phase,
			strconv.Itoa(entry.ContextTokensUsed),
			entry.ContextPercentage,
			entry.SearchTermInTranscript,
			fmt.Sprintf("%.6f", entry.RequestCost),
			fmt.Sprintf("%.6f", entry.TotalCost),
			entry.CostNotes,
			entry.Timestamp,
			entry.TimeApprox,
		}
		if err := writer.Write(record); err != nil {
			log.Fatalf("❌ Error writing CSV record: %v", err)
		}
	}

	fmt.Printf("✅ Successfully updated %s with %d cost entries\n", csvFile, len(apiCosts))
	fmt.Printf("💰 Total cost for this task: $%.6f\n", totalCost)
}

