	CacheReads  int     `json:"cacheReads"`
}

// CostEntry represents a single cost tracking entry
type CostEntry struct {
	RequestID              string
	UserRequest            string
	ClineAction            string
	ToolUsed               string
	HasImages              string
	Phase                  string
	ContextTokensUsed      int
	ContextPercentage      string
	SearchTermInTranscript string
	RequestCost            float64
	TotalCost              float64
	CostNotes              string
	Timestamp              string
	TimeApprox             string
}

